import { describe, it, after, before } from 'mocha';
import assert from 'assert';
import { By, until } from 'selenium-webdriver';
import { buildDriver, BASE_URL, TIMEOUT, registerUser, login } from './helpers.mjs';
import path from 'path';
import fs from 'fs';
import os from 'os';

/**
 * US02 – Cadastrar novo animal
 * Como usuario logado,
 * quero postar um anuncio de um animal com foto e informações
 * para que outras pessoas vejam que ele ta pra adoção.
 */
describe('US02 – Cadastrar novo animal', function () {
    this.timeout(60000);
    let driver;
    let testEmail;
    let testPassword;
    let tempImagePath;

    before(async function () {
        driver = buildDriver();

        // Registra e loga um usuario pra poder cadastrar animal
        const result = await registerUser(driver);
        testEmail = result.email;
        testPassword = result.password;

        // Cria uma imagem temporaria pra usar no upload (1x1 pixel PNG)
        const pngBuffer = Buffer.from(
            '',
            'base64'
        );
        tempImagePath = path.join(os.tmpdir(), `test_animal_${Date.now()}.png`);
        fs.writeFileSync(tempImagePath, pngBuffer);
    });

    after(async function () {
        await driver.quit();
        // Limpa a imagem temporaria
        if (tempImagePath && fs.existsSync(tempImagePath)) {
            fs.unlinkSync(tempImagePath);
        }
    });

    it('Cenario de sucesso: preenche nome, tipo e genero, sobe foto e salva. O animal aparece na lista', async function () {
        await login(driver, testEmail, testPassword);

        // Navega pra pagina de cadastrar animal
        await driver.get(`${BASE_URL}/area_logada/disponibilizar_animal`);
        await driver.wait(until.elementLocated(By.css('h1')), TIMEOUT);

        // Preenche o nome do animal
        const nameInput = await driver.findElement(By.css('input[name="name"]'));
        await nameInput.sendKeys('Ravena');

        // Seleciona o tipo usando o Radix Select - clica no trigger e depois na opção
        const typeTriggers = await driver.findElements(By.css('button[role="combobox"]'));
        await typeTriggers[0].click();
        await driver.sleep(500);

        // Clica na opção "Cachorro" no dropdown
        const cachorroOption = await driver.wait(
            until.elementLocated(By.xpath("//div[@role='option']//span[text()='Cachorro']")),
            TIMEOUT
        );
        await cachorroOption.click();
        await driver.sleep(300);

        // Seleciona o genero - clica no segundo trigger
        const genderTriggers = await driver.findElements(By.css('button[role="combobox"]'));
        await genderTriggers[1].click();
        await driver.sleep(500);

        // Clica na opção "Macho"
        const machoOption = await driver.wait(
            until.elementLocated(By.xpath("//div[@role='option']//span[text()='Macho']")),
            TIMEOUT
        );
        await machoOption.click();
        await driver.sleep(300);

        // Faz upload da foto pelo input de arquivo escondido
        const fileInput = await driver.findElement(By.css('input[type="file"]'));
        await fileInput.sendKeys(tempImagePath);
        await driver.sleep(500);

        // Clica em cadastrar
        const submitButton = await driver.findElement(By.xpath("//button[contains(text(),'Cadastrar')]"));
        await submitButton.click();

        // Espera o alerta de sucesso
        await driver.wait(until.alertIsPresent(), TIMEOUT);
        const alert = await driver.switchTo().alert();
        const alertText = await alert.getText();
        assert.ok(
            alertText.includes('Animal cadastrado com sucesso'),
            `Esperava alerta de sucesso mas veio: "${alertText}"`
        );
        await alert.accept();

        // Deve redirecionar pra pagina de "Meus animais"
        await driver.wait(until.urlContains('/meus_animais'), TIMEOUT);

        // Verifica se o animal aparece na lista
        await driver.sleep(1000);
        const pageSource = await driver.getPageSource();
        assert.ok(
            pageSource.includes('Ravena'),
            'Esperava o animal "Ravena" aparecer na lista de meus animais'
        );
    });

    it('Cenario de erro: esquecer campo obrigatório ou nao colocar foto impede de salvar', async function () {
        await login(driver, testEmail, testPassword);

        // Navega pra pagina de cadastrar animal
        await driver.get(`${BASE_URL}/area_logada/disponibilizar_animal`);
        await driver.wait(until.elementLocated(By.css('h1')), TIMEOUT);

        // Tenta enviar o formulario sem preencher nada
        const submitButton = await driver.findElement(By.xpath("//button[contains(text(),'Cadastrar')]"));
        await submitButton.click();

        // Espera as mensagens de validação aparecerem
        await driver.sleep(1000);

        const pageSource = await driver.getPageSource();

        // Deve mostrar erro pedindo o nome (campo obrigatorio)
        const temErroNome = pageSource.includes('obrigatório') || pageSource.includes('O nome');
        // Deve mostrar erro pedindo foto
        const temErroFoto = pageSource.includes('foto') || pageSource.includes('Adicione');

        assert.ok(
            temErroNome || temErroFoto,
            'Esperava mensagens de erro de campos obrigatorios ou foto faltando'
        );
    });
});
